// ProfilesPage.js

import React from 'react';
import '../App.css';
import data from './data';
import Button from './Button';

function createButton(elements) {
  <Button 
    img = {elements.img} 
    Name = {elements.Name}
  />
}

function ProfilesPage() {

  return (
    <div>
      <div className="container">
        <div className="portfolio-grid">{data.map(createButton)}</div>
      </div>
    </div>
  );
};

export default ProfilesPage;
